  }
  else {
  int stats_size = jbig2_generic_stats_size ( ctx , params . GBTEMPLATE ) ;
  GB_stats = jbig2_new ( ctx , Jbig2ArithCx , stats_size ) ;
  if ( GB_stats == NULL ) {
  code = jbig2_error ( ctx , JBIG2_SEVERITY_FATAL , segment -> number , "unable to allocate GB_stats in jbig2_immediate_generic_region" ) ;
  goto cleanup ;
  }
  memset ( GB_stats , 0 , stats_size ) ;
  ws = jbig2_word_stream_buf_new ( ctx , segment_data + offset , segment -> data_length - offset ) ;
  if ( ws == NULL ) {
  code = jbig2_error ( ctx , JBIG2_SEVERITY_FATAL , segment -> number , "unable to allocate ws in jbig2_immediate_generic_region" ) ;
  goto cleanup ;
  }
  as = jbig2_arith_new ( ctx , ws ) ;
  if ( as == NULL ) {
  code = jbig2_error ( ctx , JBIG2_SEVERITY_FATAL , segment -> number , "unable to allocate as in jbig2_immediate_generic_region" ) ;
  goto cleanup ;
  }
  code = jbig2_decode_generic_region ( ctx , segment , & params , as , image , GB_stats ) ;
  }
  if ( code >= 0 ) jbig2_page_add_result ( ctx , & ctx -> pages [ ctx -> current_page ] , image , rsi . x , rsi . y , rsi . op ) ;
  else jbig2_error ( ctx , JBIG2_SEVERITY_FATAL , segment -> number , "error while decoding immediate_generic_region" ) ;
  cleanup : jbig2_free ( ctx -> allocator , as ) ;
  jbig2_word_stream_buf_free ( ctx , ws ) ;
  jbig2_free ( ctx -> allocator , GB_stats ) ;
  jbig2_image_release ( ctx , image ) ;
  return code ;
  }

int jbig2_decode_halftone_region ( Jbig2Ctx * ctx , Jbig2Segment * segment , Jbig2HalftoneRegionParams * params , const byte * data , const size_t size , Jbig2Image * image , Jbig2ArithCx * GB_stats ) {
  uint32_t HBPP ;
  uint32_t HNUMPATS ;
  uint8_t * * GI ;
  Jbig2Image * HSKIP = NULL ;
  Jbig2PatternDict * HPATS ;
  int i ;
  uint32_t mg , ng ;
  int32_t x , y ;
  uint8_t gray_val ;
  memset ( image -> data , params -> HDEFPIXEL , image -> stride * image -> height ) ;
  if ( params -> HENABLESKIP == 1 ) {
  jbig2_error ( ctx , JBIG2_SEVERITY_WARNING , segment -> number , "unhandled option HENABLESKIP" ) ;
  }
  HPATS = jbig2_decode_ht_region_get_hpats ( ctx , segment ) ;
  if ( ! HPATS ) {
  jbig2_error ( ctx , JBIG2_SEVERITY_WARNING , segment -> number , "no pattern dictionary found, skipping halftone image" ) ;
  return - 1 ;
  }
  HNUMPATS = HPATS -> n_patterns ;
  HBPP = 0 ;
  while ( HNUMPATS > ( 1 << ++ HBPP ) ) ;
  GI = jbig2_decode_gray_scale_image ( ctx , segment , data , size , params -> HMMR , params -> HGW , params -> HGH , HBPP , params -> HENABLESKIP , HSKIP , params -> HTEMPLATE , GB_stats ) ;
  if ( ! GI ) {
  jbig2_error ( ctx , JBIG2_SEVERITY_WARNING , segment -> number , "unable to acquire gray-scale image, skipping halftone image" ) ;
  return - 1 ;
  }
  for ( mg = 0 ;
  mg < params -> HGH ;
  ++ mg ) {
  for ( ng = 0 ;
  ng < params -> HGW ;
  ++ ng ) {
  x = ( params -> HGX + mg * params -> HRY + ng * params -> HRX ) >> 8 ;
  y = ( params -> HGY + mg * params -> HRX - ng * params -> HRY ) >> 8 ;
  gray_val = GI [ ng ] [ mg ] ;
  if ( gray_val >= HNUMPATS ) {
  jbig2_error ( ctx , JBIG2_SEVERITY_WARNING , segment -> number , "gray-scale image uses value %d which larger than pattern dictionary" , gray_val ) ;
  gray_val = HNUMPATS - 1 ;
  }
  jbig2_image_compose ( ctx , image , HPATS -> patterns [ gray_val ] , x , y , params -> op ) ;
  }
  }
  for ( i = 0 ;
  i < params -> HGW ;
  ++ i ) {
  jbig2_free ( ctx -> allocator , GI [ i ] ) ;
  }
  jbig2_free ( ctx -> allocator , GI ) ;
  return 0 ;
  }

int curl_mvsnprintf ( char * buffer , size_t maxlength , const char * format , va_list ap_save ) {
  int retcode ;
  struct nsprintf info ;
  info . buffer = buffer ;
  info . length = 0 ;
  info . max = maxlength ;
  retcode = dprintf_formatf ( & info , addbyter , format , ap_save ) ;
  if ( ( retcode != - 1 ) && info . max ) {
  if ( info . max == info . length ) info . buffer [ - 1 ] = 0 ;
  else info . buffer [ 0 ] = 0 ;
  }
  return retcode ;
  }

uint8_t * * jbig2_decode_gray_scale_image ( Jbig2Ctx * ctx , Jbig2Segment * segment , const byte * data , const size_t size , bool GSMMR , uint32_t GSW , uint32_t GSH , uint32_t GSBPP , bool GSUSESKIP , Jbig2Image * GSKIP , int GSTEMPLATE , Jbig2ArithCx * GB_stats ) {
  uint8_t * * GSVALS = NULL ;
  size_t consumed_bytes = 0 ;
  int i , j , code , stride ;
  int x , y ;
  Jbig2Image * * GSPLANES ;
  Jbig2GenericRegionParams rparams ;
  Jbig2WordStream * ws = NULL ;
  Jbig2ArithState * as = NULL ;
  GSPLANES = jbig2_new ( ctx , Jbig2Image * , GSBPP ) ;
  if ( GSPLANES == NULL ) {
  jbig2_error ( ctx , JBIG2_SEVERITY_FATAL , segment -> number , "failed to allocate %d bytes for GSPLANES" , GSBPP ) ;
  return NULL ;
  }
  for ( i = 0 ;
  i < GSBPP ;
  ++ i ) {
  GSPLANES [ i ] = jbig2_image_new ( ctx , GSW , GSH ) ;
  if ( GSPLANES [ i ] == NULL ) {
  jbig2_error ( ctx , JBIG2_SEVERITY_FATAL , segment -> number , "failed to allocate %dx%d image for GSPLANES" , GSW , GSH ) ;
  for ( j = i - 1 ;
  j >= 0 ;
  -- j ) {
  jbig2_image_release ( ctx , GSPLANES [ j ] ) ;
  }
  jbig2_free ( ctx -> allocator , GSPLANES ) ;
  return NULL ;
  }
  }
  rparams . MMR = GSMMR ;
  rparams . GBTEMPLATE = GSTEMPLATE ;
  rparams . TPGDON = 0 ;
  rparams . USESKIP = GSUSESKIP ;
  rparams . gbat [ 0 ] = ( GSTEMPLATE <= 1 ? 3 : 2 ) ;
  rparams . gbat [ 1 ] = - 1 ;
  rparams . gbat [ 2 ] = - 3 ;
  rparams . gbat [ 3 ] = - 1 ;
  rparams . gbat [ 4 ] = 2 ;
  rparams . gbat [ 5 ] = - 2 ;
  rparams . gbat [ 6 ] = - 2 ;
  rparams . gbat [ 7 ] = - 2 ;
  if ( GSMMR ) {
  code = jbig2_decode_halftone_mmr ( ctx , & rparams , data , size , GSPLANES [ GSBPP - 1 ] , & consumed_bytes ) ;
  }
  else {
  ws = jbig2_word_stream_buf_new ( ctx , data , size ) ;
  if ( ws == NULL ) {
  jbig2_error ( ctx , JBIG2_SEVERITY_FATAL , segment -> number , "failed to allocate ws in jbig2_decode_gray_scale_image" ) ;
  goto cleanup ;
  }
  as = jbig2_arith_new ( ctx , ws ) ;
  if ( as == NULL ) {
  jbig2_error ( ctx , JBIG2_SEVERITY_FATAL , segment -> number , "failed to allocate as in jbig2_decode_gray_scale_image" ) ;
  goto cleanup ;
  }
  code = jbig2_decode_generic_region ( ctx , segment , & rparams , as , GSPLANES [ GSBPP - 1 ] , GB_stats ) ;
  }
  if ( code != 0 ) {
  jbig2_error ( ctx , JBIG2_SEVERITY_FATAL , segment -> number , "error decoding GSPLANES for halftone image" ) ;
  goto cleanup ;
  }
  j = GSBPP - 2 ;
  while ( j >= 0 ) {
  if ( GSMMR ) {
  code = jbig2_decode_halftone_mmr ( ctx , & rparams , data + consumed_bytes , size - consumed_bytes , GSPLANES [ j ] , & consumed_bytes ) ;
  }
  else {
  code = jbig2_decode_generic_region ( ctx , segment , & rparams , as , GSPLANES [ j ] , GB_stats ) ;
  }
  if ( code != 0 ) {
  jbig2_error ( ctx , JBIG2_SEVERITY_FATAL , segment -> number , "error decoding GSPLANES for halftone image" ) ;
  goto cleanup ;
  }
  stride = GSPLANES [ 0 ] -> stride ;
  for ( i = 0 ;
  i < stride * GSH ;
  ++ i ) GSPLANES [ j ] -> data [ i ] ^= GSPLANES [ j + 1 ] -> data [ i ] ;
  -- j ;
  }
  GSVALS = jbig2_new ( ctx , uint8_t * , GSW ) ;
  if ( GSVALS == NULL ) {
  jbig2_error ( ctx , JBIG2_SEVERITY_FATAL , segment -> number , "failed to allocate GSVALS: %d bytes" , GSW ) ;
  goto cleanup ;
  }
  for ( i = 0 ;
  i < GSW ;
  ++ i ) {
  GSVALS [ i ] = jbig2_new ( ctx , uint8_t , GSH ) ;
  if ( GSVALS [ i ] == NULL ) {
  jbig2_error ( ctx , JBIG2_SEVERITY_FATAL , segment -> number , "failed to allocate GSVALS: %d bytes" , GSH * GSW ) ;
  for ( j = i - 1 ;
  j >= 0 ;
  -- j ) {
  jbig2_free ( ctx -> allocator , GSVALS [ j ] ) ;
  }
  jbig2_free ( ctx -> allocator , GSVALS ) ;
  GSVALS = NULL ;
  goto cleanup ;
  }
  }
  for ( x = 0 ;
  x < GSW ;
  ++ x ) {
  for ( y = 0 ;
  y < GSH ;
  ++ y ) {
  GSVALS [ x ] [ y ] = 0 ;
  for ( j = 0 ;
  j < GSBPP ;
  ++ j ) GSVALS [ x ] [ y ] += jbig2_image_get_pixel ( GSPLANES [ j ] , x , y ) << j ;
  }
  }
  cleanup : if ( ! GSMMR ) {
  jbig2_free ( ctx -> allocator , as ) ;
  jbig2_word_stream_buf_free ( ctx , ws ) ;
  }
  for ( i = 0 ;
  i < GSBPP ;
  ++ i ) jbig2_image_release ( ctx , GSPLANES [ i ] ) ;
  jbig2_free ( ctx -> allocator , GSPLANES ) ;
  return GSVALS ;
  }

int curl_msprintf ( char * buffer , const char * format , ... ) {
  va_list ap_save ;
  int retcode ;
  va_start ( ap_save , format ) ;
  retcode = dprintf_formatf ( & buffer , storebuffer , format , ap_save ) ;
  va_end ( ap_save ) ;
  * buffer = 0 ;
  return retcode ;
  }

int jbig2_page_add_result ( Jbig2Ctx * ctx , Jbig2Page * page , Jbig2Image * image , int x , int y , Jbig2ComposeOp op ) {
  if ( page -> image == NULL ) {
  jbig2_error ( ctx , JBIG2_SEVERITY_WARNING , - 1 , "page info possibly missing, no image defined" ) ;
  return 0 ;
  }
  if ( page -> striped ) {
  int new_height = y + image -> height + page -> end_row ;
  if ( page -> image -> height < new_height ) {
  jbig2_error ( ctx , JBIG2_SEVERITY_DEBUG , - 1 , "growing page buffer to %d rows " "to accomodate new stripe" , new_height ) ;
  jbig2_image_resize ( ctx , page -> image , page -> image -> width , new_height ) ;
  }
  }
  jbig2_image_compose ( ctx , page -> image , image , x , y + page -> end_row , op ) ;
  return 0 ;
  }

int jbig2_end_of_stripe ( Jbig2Ctx * ctx , Jbig2Segment * segment , const uint8_t * segment_data ) {
  Jbig2Page page = ctx -> pages [ ctx -> current_page ] ;
  int end_row ;
  end_row = jbig2_get_int32 ( segment_data ) ;
  if ( end_row < page . end_row ) {
  jbig2_error ( ctx , JBIG2_SEVERITY_WARNING , segment -> number , "end of stripe segment with non-positive end row advance" " (new end row %d vs current end row %d)" , end_row , page . end_row ) ;
  }
  else {
  jbig2_error ( ctx , JBIG2_SEVERITY_INFO , segment -> number , "end of stripe: advancing end row to %d" , end_row ) ;
  }
  page . end_row = end_row ;
  return 0 ;
  }

static int dprintf_Pass1 ( const char * format , va_stack_t * vto , char * * endpos , va_list arglist ) {
  char * fmt = ( char * ) format ;
  int param_num = 0 ;
  long this_param ;
  long width ;
  long precision ;
  int flags ;
  long max_param = 0 ;
  long i ;
  while ( * fmt ) {
  if ( * fmt ++ == '%' ) {
  if ( * fmt == '%' ) {
  fmt ++ ;
  continue ;
  }
  flags = FLAGS_NEW ;
  param_num ++ ;
  this_param = dprintf_DollarString ( fmt , & fmt ) ;
  if ( 0 == this_param ) this_param = param_num ;
  if ( this_param > max_param ) max_param = this_param ;
  width = 0 ;
  precision = 0 ;
  while ( dprintf_IsQualifierNoDollar ( fmt ) ) {
  # if defined ( MP_HAVE_INT_EXTENSIONS ) if ( ! strncmp ( fmt , "I32" , 3 ) ) {
  flags |= FLAGS_LONG ;
  fmt += 3 ;
  }
  else if ( ! strncmp ( fmt , "I64" , 3 ) ) {
  flags |= FLAGS_LONGLONG ;
  fmt += 3 ;
  }
  else # endif switch ( * fmt ++ ) {
  case ' ' : flags |= FLAGS_SPACE ;
  break ;
  case '+' : flags |= FLAGS_SHOWSIGN ;
  break ;
  case '-' : flags |= FLAGS_LEFT ;
  flags &= ~ FLAGS_PAD_NIL ;
  break ;
  case '#' : flags |= FLAGS_ALT ;
  break ;
  case '.' : flags |= FLAGS_PREC ;
  if ( '*' == * fmt ) {
  flags |= FLAGS_PRECPARAM ;
  fmt ++ ;
  param_num ++ ;
  i = dprintf_DollarString ( fmt , & fmt ) ;
  if ( i ) precision = i ;
  else precision = param_num ;
  if ( precision > max_param ) max_param = precision ;
  }
  else {
  flags |= FLAGS_PREC ;
  precision = strtol ( fmt , & fmt , 10 ) ;
  }
  break ;
  case 'h' : flags |= FLAGS_SHORT ;
  break ;
  # if defined ( MP_HAVE_INT_EXTENSIONS ) case 'I' : # if ( CURL_SIZEOF_CURL_OFF_T > CURL_SIZEOF_LONG ) flags |= FLAGS_LONGLONG ;
  # else flags |= FLAGS_LONG ;
  # endif break ;
  # endif case 'l' : if ( flags & FLAGS_LONG ) flags |= FLAGS_LONGLONG ;
  else flags |= FLAGS_LONG ;
  break ;
  case 'L' : flags |= FLAGS_LONGDOUBLE ;
  break ;
  case 'q' : flags |= FLAGS_LONGLONG ;
  break ;
  case 'z' : # if ( SIZEOF_SIZE_T > CURL_SIZEOF_LONG ) flags |= FLAGS_LONGLONG ;
  # else flags |= FLAGS_LONG ;
  # endif break ;
  case 'O' : # if ( CURL_SIZEOF_CURL_OFF_T > CURL_SIZEOF_LONG ) flags |= FLAGS_LONGLONG ;
  # else flags |= FLAGS_LONG ;
  # endif break ;
  case '0' : if ( ! ( flags & FLAGS_LEFT ) ) flags |= FLAGS_PAD_NIL ;
  case '1' : case '2' : case '3' : case '4' : case '5' : case '6' : case '7' : case '8' : case '9' : flags |= FLAGS_WIDTH ;
  width = strtol ( fmt - 1 , & fmt , 10 ) ;
  break ;
  case '*' : flags |= FLAGS_WIDTHPARAM ;
  param_num ++ ;
  i = dprintf_DollarString ( fmt , & fmt ) ;
  if ( i ) width = i ;
  else width = param_num ;
  if ( width > max_param ) max_param = width ;
  break ;
  default : break ;
  }
  }
  i = this_param - 1 ;
  if ( ( i < 0 ) || ( i >= MAX_PARAMETERS ) ) return 1 ;
  switch ( * fmt ) {
  case 'S' : flags |= FLAGS_ALT ;
  case 's' : vto [ i ] . type = FORMAT_STRING ;
  break ;
  case 'n' : vto [ i ] . type = FORMAT_INTPTR ;
  break ;
  case 'p' : vto [ i ] . type = FORMAT_PTR ;
  break ;
  case 'd' : case 'i' : vto [ i ] . type = FORMAT_INT ;
  break ;
  case 'u' : vto [ i ] . type = FORMAT_INT ;
  flags |= FLAGS_UNSIGNED ;
  break ;
  case 'o' : vto [ i ] . type = FORMAT_INT ;
  flags |= FLAGS_OCTAL ;
  break ;
  case 'x' : vto [ i ] . type = FORMAT_INT ;
  flags |= FLAGS_HEX | FLAGS_UNSIGNED ;
  break ;
  case 'X' : vto [ i ] . type = FORMAT_INT ;
  flags |= FLAGS_HEX | FLAGS_UPPER | FLAGS_UNSIGNED ;
  break ;
  case 'c' : vto [ i ] . type = FORMAT_INT ;
  flags |= FLAGS_CHAR ;
  break ;
  case 'f' : vto [ i ] . type = FORMAT_DOUBLE ;
  break ;
  case 'e' : vto [ i ] . type = FORMAT_DOUBLE ;
  flags |= FLAGS_FLOATE ;
  break ;
  case 'E' : vto [ i ] . type = FORMAT_DOUBLE ;
  flags |= FLAGS_FLOATE | FLAGS_UPPER ;
  break ;
  case 'g' : vto [ i ] . type = FORMAT_DOUBLE ;
  flags |= FLAGS_FLOATG ;
  break ;
  case 'G' : vto [ i ] . type = FORMAT_DOUBLE ;
  flags |= FLAGS_FLOATG | FLAGS_UPPER ;
  break ;
  default : vto [ i ] . type = FORMAT_UNKNOWN ;
  break ;
  }
  vto [ i ] . flags = flags ;
  vto [ i ] . width = width ;
  vto [ i ] . precision = precision ;
  if ( flags & FLAGS_WIDTHPARAM ) {
  long k = width - 1 ;
  vto [ i ] . width = k ;
  vto [ k ] . type = FORMAT_WIDTH ;
  vto [ k ] . flags = FLAGS_NEW ;
  vto [ k ] . width = 0 ;
  vto [ k ] . precision = 0 ;
  }
  if ( flags & FLAGS_PRECPARAM ) {
  long k = precision - 1 ;
  vto [ i ] . precision = k ;
  vto [ k ] . type = FORMAT_WIDTH ;
  vto [ k ] . flags = FLAGS_NEW ;
  vto [ k ] . width = 0 ;
  vto [ k ] . precision = 0 ;
  }
  * endpos ++ = fmt + 1 ;
  }
  }
  for ( i = 0 ;
  i < max_param ;
  i ++ ) {
  if ( vto [ i ] . flags & FLAGS_WIDTHPARAM ) {
  vto [ vto [ i ] . width ] . data . num . as_signed = ( mp_intmax_t ) va_arg ( arglist , int ) ;
  }
  if ( vto [ i ] . flags & FLAGS_PRECPARAM ) {
  vto [ vto [ i ] . precision ] . data . num . as_signed = ( mp_intmax_t ) va_arg ( arglist , int ) ;
  }
  switch ( vto [ i ] . type ) {
  case FORMAT_STRING : vto [ i ] . data . str = va_arg ( arglist , char * ) ;
  break ;
  case FORMAT_INTPTR : case FORMAT_UNKNOWN : case FORMAT_PTR : vto [ i ] . data . ptr = va_arg ( arglist , void * ) ;
  break ;
  case FORMAT_INT : # ifdef HAVE_LONG_LONG_TYPE if ( ( vto [ i ] . flags & FLAGS_LONGLONG ) && ( vto [ i ] . flags & FLAGS_UNSIGNED ) ) vto [ i ] . data . num . as_unsigned = ( mp_uintmax_t ) va_arg ( arglist , mp_uintmax_t ) ;
  else if ( vto [ i ] . flags & FLAGS_LONGLONG ) vto [ i ] . data . num . as_signed = ( mp_intmax_t ) va_arg ( arglist , mp_intmax_t ) ;
  else # endif {
  if ( ( vto [ i ] . flags & FLAGS_LONG ) && ( vto [ i ] . flags & FLAGS_UNSIGNED ) ) vto [ i ] . data . num . as_unsigned = ( mp_uintmax_t ) va_arg ( arglist , unsigned long ) ;
  else if ( vto [ i ] . flags & FLAGS_LONG ) vto [ i ] . data . num . as_signed = ( mp_intmax_t ) va_arg ( arglist , long ) ;
  else if ( vto [ i ] . flags & FLAGS_UNSIGNED ) vto [ i ] . data . num . as_unsigned = ( mp_uintmax_t ) va_arg ( arglist , unsigned int ) ;
  else vto [ i ] . data . num . as_signed = ( mp_intmax_t ) va_arg ( arglist , int ) ;
  }
  break ;
  case FORMAT_DOUBLE : vto [ i ] . data . dnum = va_arg ( arglist , double ) ;
  break ;
  case FORMAT_WIDTH : vto [ i ] . type = FORMAT_INT ;
  break ;
  default : break ;
  }
  }
  return 0 ;
  }

int jbig2_decode_generic_mmr ( Jbig2Ctx * ctx , Jbig2Segment * segment , const Jbig2GenericRegionParams * params , const byte * data , size_t size , Jbig2Image * image ) {
  Jbig2MmrCtx mmr ;
  const int rowstride = image -> stride ;
  byte * dst = image -> data ;
  byte * ref = NULL ;
  int y ;
  int code = 0 ;
  jbig2_decode_mmr_init ( & mmr , image -> width , image -> height , data , size ) ;
  for ( y = 0 ;
  y < image -> height ;
  y ++ ) {
  memset ( dst , 0 , rowstride ) ;
  code = jbig2_decode_mmr_line ( & mmr , ref , dst ) ;
  if ( code < 0 ) return code ;
  ref = dst ;
  dst += rowstride ;
  }
  return code ;
  }
